CREATE Temporary TABLE loc_retail(
	Lat         NUMERIC(19,14)
	,Lng         NUMERIC(18,15)
	,Name        VARCHAR(31)
	,ZoneName    VARCHAR(24)
	,ExpansionId INTEGER 
);

Select
	Unhex(Md5(Concat(z.ExpansionId,z.Name,l.Name)))
	,z.Id, l.Name, l.Lat, l.Lng
From loc_retail l
Inner Join Zones z
On z.Name = l.ZoneName
Where z.ExpansionId = l.ExpansionId;

Drop Table loc_retail;
